import React from "react";
import "./header.css";

const Header = () => {
  return (
    /*We're putting the class of container inside this HTML*/
    <header>
      <div className="container header_container">
        <h5>Hello I'm</h5>
      </div>
    </header>
  );
};

export default Header;
